import styled from 'styled-components';

const DiaryBackground = styled.div`
    width: 100%;
    min-height: 90vh;
    background-color: #efefef;
    margin-top: 4rem;
`;

const DiaryContainer = styled.div`
    width: 85%;
    height: 40vh;
    margin: 2rem auto;
    background-color: white;
    border-radius: 10px;
    display: flex;
    flex-direction: column;
    justify-content: space-between;
    align-items: center;
`
const DiaryDiv = styled.div`
    width: 85%;
    height: 85%;
    margin: 2rem;
    display: flex;
    flex-direction: column;
    justify-content: space-between;
    align-items: center;
`

const DiaryContext = styled.p`
    font-size: 1.2rem;
    color: gray;
    text-align: center;
`

const FeelAngry = styled.div`
    width: 10%;
    height: 25%;
    background-color: red;
`

const FeelBad = styled.div`
    width: 10%;
