                <DiaryContext>
                    안녕하세요 서준님,
                </DiaryContext>
                <DiaryContext>
                    안녕하세요 서준님,
                </DiaryContext>
                <FeelAngry>

                </FeelAngry>
                </DiaryDiv>
            </DiaryContainer>
        </DiaryBackground>
    );
};

export default MyDiary;
